import logo from './logo.svg';
import './App.css';
import Card from './components/Card';
import NavBar from './components/NavBar';
import data from './data';
import imgStar from './images/Star.png'
import FooterSec from './components/FooterSec';
import {Route, Routes } from 'react-router-dom';
import Deserts from './components/Deserts';
import MainDishes from './components/MainDishes';
import Drinks from './components/Drinks';
import CrudDish from './components/CrudDish';
import React from 'react';

React.

React.useEffect(()=>{
  Axios.get('http://localhost:3001/api/get').then((response)=>{
      console.log(response.data)
  })
}, [])

function App() {
  const menuArr = data.map(dish =>{
    return <Card
    key={dish.id}
    img={imgStar}
    {...dish}/>
  })

  return (
    <div className="App">
      <NavBar img='https://coffeeboom.kz/themes/coffeeboom/src/build/images/logo.svg'/>
      <Routes>
          <Route path='/' element={<section className='cards-list'>{menuArr}</section>} />
          <Route path='/deserts' element={<Deserts />} />
          <Route path='/mainDish' element={<MainDishes />} />
          <Route path='/drinks' element={<Drinks />} />
          <Route path='/crud_dish' element={<CrudDish />} />
      </Routes> 
      <FooterSec />
    </div>
  );
}

export default App;
